"use strict";(self.webpackChunkcontrolz_docs=self.webpackChunkcontrolz_docs||[]).push([[6851],{3332:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"release-2025-1-9","metadata":{"permalink":"/Controlz-Docs/es/blog/release-2025-1-9","source":"@site/i18n/es/docusaurus-plugin-content-blog/2025-06-3-post.md","title":"Lanzamiento de Controlz 2025.1.9","description":"\ud83d\ude80 \xa1Controlz 2025.1.9 ya est\xe1 disponible en la Mac App Store!","date":"2025-06-03T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/Controlz-Docs/es/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/Controlz-Docs/es/blog/tags/test","description":"Testing news"}],"readingTime":0.33,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Controlz developer","url":"https://github.com/llOzzeell","page":{"permalink":"/Controlz-Docs/es/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"release-2025-1-9","title":"Lanzamiento de Controlz 2025.1.9","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"nextItem":{"title":"Lanzamiento Controlz 2025.1.5","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-5"}},"content":"import { MacAppStoreBadge } from \'@site/src/pages/\';\\n\\n## \ud83d\ude80 \xa1Controlz 2025.1.9 ya est\xe1 disponible en la Mac App Store!\\n\\n\xa1Nos complace anunciar el lanzamiento de Controlz 2025.1.9 como una aplicaci\xf3n nativa para macOS!\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\nAhora puedes disfrutar de un rendimiento completo en el escritorio e integraci\xf3n perfecta con macOS.  \\nDesc\xe1rgalo hoy mismo desde la Mac App Store y toma el control de tus creaciones LEGO\xae como nunca antes.\\n\\n<MacAppStoreBadge/>"},{"id":"closed-test-release-2025-1-5","metadata":{"permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-5","source":"@site/i18n/es/docusaurus-plugin-content-blog/2025-05-17-post.md","title":"Lanzamiento Controlz 2025.1.5","description":"Descripci\xf3n","date":"2025-05-17T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/Controlz-Docs/es/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/Controlz-Docs/es/blog/tags/test","description":"Testing news"}],"readingTime":0.64,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Controlz developer","url":"https://github.com/llOzzeell","page":{"permalink":"/Controlz-Docs/es/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-5","title":"Lanzamiento Controlz 2025.1.5","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Lanzamiento de Controlz 2025.1.9","permalink":"/Controlz-Docs/es/blog/release-2025-1-9"},"nextItem":{"title":"Lanzamiento Controlz 2025.1.4","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-4"}},"content":"### Descripci\xf3n\\n\\nEsta actualizaci\xf3n mejora la experiencia de edici\xf3n de bloques, incrementa el rendimiento y garantiza un funcionamiento adecuado en versiones m\xe1s recientes de Android.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### Cambios\\n\\n- **Se corrigi\xf3 un error con el escaneo de hubs en Android 12+** solicitando permiso de ubicaci\xf3n precisa.\\n- **Se a\xf1adi\xf3 una opci\xf3n para mostrar/ocultar la paleta de bloques** haciendo clic en la colecci\xf3n de bloques seleccionada.\\n- **Se a\xf1adi\xf3 un control de redimensionamiento** a la paleta de bloques para permitir **cambios de tama\xf1o manuales**.\\n- **Se corrigi\xf3 un alto uso de CPU** cuando se cargaba un perfil pero el programa no se estaba ejecutando.\\n- **Se mejor\xf3 el editor del bloque \\"Lista de cadenas\\"** para evitar que se cortara el contenido. Ahora los elementos se dividen en columnas para mejor visibilidad en listas grandes."},{"id":"closed-test-release-2025-1-4","metadata":{"permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-4","source":"@site/i18n/es/docusaurus-plugin-content-blog/2025-05-10-post.md","title":"Lanzamiento Controlz 2025.1.4","description":"Descripci\xf3n","date":"2025-05-10T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/Controlz-Docs/es/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/Controlz-Docs/es/blog/tags/test","description":"Testing news"}],"readingTime":1.05,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Controlz developer","url":"https://github.com/llOzzeell","page":{"permalink":"/Controlz-Docs/es/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-4","title":"Lanzamiento Controlz 2025.1.4","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Lanzamiento Controlz 2025.1.5","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-5"},"nextItem":{"title":"Lanzamiento Controlz 2025.1.2 - 2025.1.3","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-2-3"}},"content":"### Descripci\xf3n\\n\\nEsta actualizaci\xf3n mejora el soporte para tablets, a\xf1ade p\xe1ginas \xfatiles de prueba y corrige varios problemas de compatibilidad y rendimiento.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### Cambios\\n\\n- **Se a\xf1adi\xf3 un dise\xf1o para tablets** para un mejor aprovechamiento de pantallas grandes.\\n- **Se corrigi\xf3 un error donde el bloque \\"bot\xf3n del hub presionado\\"** aparec\xeda para hubs que no admiten esta acci\xf3n. Tambi\xe9n se corrigieron los bloques de **sensor de color inadecuados** para hubs no compatibles (por ejemplo, BuWizz).\\n- **Se corrigi\xf3 un error donde el bloque \\"motor run\\"** no afectaba a motores sin codificadores debido a la falta de comandos alternativos de ejecuci\xf3n.\\n- **Se a\xf1adi\xf3 una p\xe1gina para probar los botones del gamepad.**\\n- **Se a\xf1adi\xf3 una p\xe1gina de prueba del hub** con un panel que muestra informaci\xf3n, dispositivos conectados a puertos y estado de vibraci\xf3n de puertos.\\n- **Se corrigi\xf3 la interpretaci\xf3n incorrecta de los datos del aceler\xf3metro** para BuWizz 2 y 3, que causaban lecturas err\xf3neas de orientaci\xf3n.\\n- **Se corrigieron fugas de memoria RAM** que provocaban el cierre de la aplicaci\xf3n en algunos dispositivos por alto uso de memoria del sistema.\\n- **Se corrigieron errores al cargar perfiles** que anteriormente causaban bloqueos en ciertos escenarios.\\n- **Se corrigi\xf3 un error en Android** donde al soltar los sticks del gamepad no se restablec\xedan los valores de los ejes a cero."},{"id":"closed-test-release-2025-1-2-3","metadata":{"permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-2-3","source":"@site/i18n/es/docusaurus-plugin-content-blog/2025-04-19-post.md","title":"Lanzamiento Controlz 2025.1.2 - 2025.1.3","description":"Descripci\xf3n","date":"2025-04-19T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/Controlz-Docs/es/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/Controlz-Docs/es/blog/tags/test","description":"Testing news"}],"readingTime":0.53,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Controlz developer","url":"https://github.com/llOzzeell","page":{"permalink":"/Controlz-Docs/es/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-2-3","title":"Lanzamiento Controlz 2025.1.2 - 2025.1.3","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Lanzamiento Controlz 2025.1.4","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-4"},"nextItem":{"title":"Lanzamiento Controlz 2025.1.1","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-1"}},"content":"### Descripci\xf3n\\n\\nEsta actualizaci\xf3n introduce nuevas opciones de personalizaci\xf3n del joystick, mejoras en la interfaz de usuario y correcciones importantes de estabilidad.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### Cambios\\n\\n- **Se corrigi\xf3 un error en el selector de colecciones de la paleta de bloques**: al seleccionar una colecci\xf3n, desplazarse a otra y regresar, no ten\xeda efecto.\\n- **Se corrigi\xf3 un bloqueo al cargar perfiles pesados** con un gran n\xfamero de bloques.\\n- **Se agreg\xf3 la propiedad \u201cTipo de ejes\u201d** a la configuraci\xf3n del joystick para admitir el **modo de un solo eje** (X, Y, XY).\\n- **Se agreg\xf3 coloraci\xf3n** para los controladores de volante (\u201cGMZ\u201d, \u201cNo Mercy\u201d).\\n- **Se agregaron bloques \u201cest\xe1 presionado\u201d** para volantes y pedales."},{"id":"closed-test-release-2025-1-1","metadata":{"permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-1","source":"@site/i18n/es/docusaurus-plugin-content-blog/2025-04-14-post.md","title":"Lanzamiento Controlz 2025.1.1","description":"Descripci\xf3n","date":"2025-04-14T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/Controlz-Docs/es/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/Controlz-Docs/es/blog/tags/test","description":"Testing news"}],"readingTime":0.59,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Controlz developer","url":"https://github.com/llOzzeell","page":{"permalink":"/Controlz-Docs/es/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-release-2025-1-1","title":"Lanzamiento Controlz 2025.1.1","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Lanzamiento Controlz 2025.1.2 - 2025.1.3","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-2-3"},"nextItem":{"title":"Controlz 2025.1.0","permalink":"/Controlz-Docs/es/blog/closed-test-begin"}},"content":"### Descripci\xf3n\\n\\nEsta actualizaci\xf3n incluye varias correcciones de errores importantes que mejoran el rendimiento, reducen el consumo de bater\xeda y optimizan el comportamiento de los bloques en el entorno de programaci\xf3n.\\n\\n\x3c!-- truncate --\x3e\\n---\\n\\n### Cambios\\n\\n- **Se corrigi\xf3 un error que causaba alto uso de CPU, drenaje de bater\xeda y bajo rendimiento.**\\n- **Se corrigi\xf3 un error en los bloques de gamepad** (por ejemplo, \u201c\xbfbot\xf3n presionado?\u201d, \u201c\xbfbot\xf3n del D-PAD presionado?\u201d) **que imped\xeda conectarlos a otros bloques.**\\n- **Se corrigi\xf3 un problema en el bloque de evento de interruptor de paso** que manejaba incorrectamente los eventos t\xe1ctiles y el conteo de pasos.\\n- **Se corrigi\xf3 un error en el bloque de lista \u201celemento de\u201d** que imped\xeda adjuntar m\xe1s de un bloque como \xedndice de argumento."},{"id":"closed-test-begin","metadata":{"permalink":"/Controlz-Docs/es/blog/closed-test-begin","source":"@site/i18n/es/docusaurus-plugin-content-blog/2025-04-04-post.md","title":"Controlz 2025.1.0","description":"\ud83d\ude80 \xa1La beta cerrada de Controlz 2025.1.0 ha comenzado!","date":"2025-04-04T00:00:00.000Z","tags":[{"inline":false,"label":"Dev","permalink":"/Controlz-Docs/es/blog/tags/dev","description":"Development news"},{"inline":false,"label":"Test","permalink":"/Controlz-Docs/es/blog/tags/test","description":"Testing news"}],"readingTime":0.33,"hasTruncateMarker":true,"authors":[{"name":"Maxim","title":"Controlz developer","url":"https://github.com/llOzzeell","page":{"permalink":"/Controlz-Docs/es/blog/authors/maxim"},"socials":{"github":"https://github.com/llOzzeell"},"imageURL":"https://avatars.githubusercontent.com/u/45766241?v=4","key":"maxim"}],"frontMatter":{"slug":"closed-test-begin","title":"Controlz 2025.1.0","authors":["maxim"],"tags":["dev","test"]},"unlisted":false,"prevItem":{"title":"Lanzamiento Controlz 2025.1.1","permalink":"/Controlz-Docs/es/blog/closed-test-release-2025-1-1"}},"content":"## \ud83d\ude80 \xa1La beta cerrada de Controlz 2025.1.0 ha comenzado!\\n\\n\xa1Estamos emocionados de anunciar que la prueba beta cerrada de Controlz 2025 ya est\xe1 activa! Los usuarios seleccionados pueden explorar nuevas funciones, proporcionar comentarios y ayudar a moldear el futuro de Controlz.\\n\\n\x3c!-- truncate --\x3e\\n\\nSi has recibido una invitaci\xf3n, revisa tu correo electr\xf3nico para obtener los detalles de acceso.  \\n\xa1Gracias por ser parte de esta fase tan importante!"}]}}')}}]);